import { InMemoryDbService } from 'angular-in-memory-web-api';
import { Sticker } from './stickers/sticker.component';
import { NgModule } from '@angular/core';

@NgModule({
  providers: [MockedDataService],
})
export class MockedDataService implements InMemoryDbService {
  createDb() {
    const stickers = [
      {id: 1, name: 'FE', content: 'Ля мсье фронтендье', background: 'data:image/png;base64,'},
      {id: 2, name: 'NoCapacity', content: 'Нет капасити думать', background: 'data:image/png;base64,'},
      {id: 3, name: 'HomeVideo', content: 'Название вашего хоум видео', background: ''},
      {id: 4, name: 'FromAuthors', content: 'От содателей КЛС, ВО и продакт импорта', background:''},
    ];
    return {stickers};
  }

  genId(stickers: Sticker[]): number {
    return stickers.length > 0 ? Math.max(...stickers.map(sticker => sticker.id)) + 1 : 2;
  }
}
